import React from "react";

function Header() {
  return (
    <header>
      <h2>
        Learn
        <img
          src="https://i.stack.imgur.com/zHFFO.png"
          width="110"
          style={{pointerEvents: "none"}}
          alt="logo"
        ></img>
      </h2>
    </header>
  );
}

export default Header;
